import React from 'react';
import LandingPage from './pages/LandingPage';
import { Router, Route, Switch } from 'react-router-dom';
import './App.css';

const App = () => {
  return (
    <div className="App">
      <Router>
        <header className="App-header">
        </header>
        <Switch>
          <Route path="/" exact component={LandingPage} />
        </Switch>
      </Router>
    </div>
  );
}

export default App;
